import mathfrom math import *import ipaddressdef almost_double_factorial(n):    if (n <= 100):        fac = 1        for i in range(1, n + 1):            if (i % 2 != 0):                fac *= i        return facdef find_difference(a, b):    count1 = 1    count2 = 1    if (len(a) == 3 and len(b) == 3):        for i in a:            if i > 0:                count1 *= i        for j in b:            if j > 0:                count2 *= j    if count1 > count2:        return count1 - count2    elif count2 > count1:        return count2 - count1    return 0print(hex(12345))print(oct(12345))print(bin(12345))num = int(input('Ввелите число: '))flag = Falseif num == 1:    print(num, 'это ни простое, ни составное число')elif num > 1:    for i in range(2, num):        if (num % i) == 0:            flag = True            break    if flag:        print(num, "это не простое число")    else:        print(num, "это простое число")def reverse_words(text):    reversed_words = []    words = text.split()    for word in words:        reversed_words.append(word[::-1])    return " ".join(reversed_words)s = input().split()lst = [int(x) for x in s]res = 0for x in lst[:]:    try:        lst.remove(x)        lst.remove(x)        res += 1    except ValueError:        passprint(res)